local function on_eat(itemstack, user, pointed_thing) mcl_hunger.set_hunger(user, math.max(mcl_hunger.get_hunger(user) - 1, 0)) return core.do_item_eat(0, nil, itemstack, user, pointed_thing) end
minetest.register_craftitem(":arkacia:plastic_strip", {
    description = minetest.colorize("#FF5555", "Plastic Strip\nHunger points: -1\nSaturation points: 0"),
    inventory_image = "blank.png^[png:",
    on_place = on_eat,
    on_secondary_use = on_eat,
    groups = { food = -1, eatable = -1, can_eat_when_full = 1 },
    _mcl_saturation = 0,
})